import React from 'react'
import styled from 'styled-components';

export default function Partners() {
    const Grid = styled.div`
    display: flex;
    grid-template-columns: repeat(2, 3fr);
    grid-gap: 70px;
    padding:20px;
    margin-left:150px;
    margin-bottom:100px;
    justify-content:space-around;
    `
  return (
    <div>
    <div >
        <h3 class="nsTitleSm">OUR PARTNERS</h3>
    </div>     
           <Grid className='classPartners'>

            <div>
            <img src="data:image/jpeg;base64," alt="" class="featureIcon"/>
            <span class="featureDesc">TRANSPARENCY INTERNATIONAL.</span>
        </div>

        <div >
            <img class="featureIcon" src="https://i.pinimg.com/564x/96/db/d3/96dbd3c5c5f68ae2636c6d7e477bc9dd.jpg" alt=""/>
            <span class="featureDesc">THE WORLD BANK .</span>

        </div>

        <div>
            <img class="featureIcon" src="data:image/jpeg;base64," alt=""/>
            <span class="featureDesc">HAKI NAWIRI AFRICA .</span>
        </div>

        </Grid> 







    </div>



  )
}
